import React, { useContext } from 'react'
import { DataStore } from '../../App'
function NavCardBtn(props) { 
  const ctx = useContext(DataStore)
  console.log('NavCardBtn.jsx')
  return (
    <div className="navbar-text" role="search">
        <button onClick={() => ctx.onCloseCard(true)} className="btn btn-outline-success" type="submit">
            <b className="me-3"><i>{props.icon}</i></b>
            <span>{ctx.cardOrder}</span>
            </button>
      </div>
  )
}

export default NavCardBtn
